import { useState } from "react";
import React from "react";

const tasks = [
  {
    id: 1,
    task: "Attend meeting",
    complete: true
  },
  {
    id: 2,
    task: "Do laundry",
    complete: true
  },
  {
    id: 3,
    task: "Complete Assignments",
    complete: false
  },
  {
    id: 4,
    task: "Attend meeting",
    complete: true
  },
  {
    id: 5,
    task: "Exercise",
    complete: false
  },
  {
    id: 6,
    task: "Buy groceries",
    complete: true
  }
];

function Hum() {
  const [message, setMessage] = useState("");
  const handleChange = (event) => {
    setMessage(event.target.value);

    console.log("value is:", event.target.value);

  };

  return (
    <div>
      <h2>TO DO LIST</h2>
      <input
        type="text"
        id="task"
        name="task"
        onChange={handleChange}
        value={message}
      />
      <button type="submit" >Submit</button>
      <h3>TASKS:{message}</h3>

      {tasks.length ? (
        <ul>
          {tasks.map((ele, index) => {
            return (
              <li
                style={{ textDecoration: ele.complete ? "line-through" : "" }}
              >
                {ele.id} - {ele.task}
              </li>
            );
          })}
        </ul>
      ) : null}
    </div>
  );
}
export default Hum;
